import React, {useState} from 'react';
import axios from "axios";

function Form3(props) {

    return (
        <div>
                <label className="form-label">
                    <div>
                        <h3>Comments:</h3>
                        <textarea required value={props.firstStep.comments} onChange={props.handleChange} name="comments" type="text" />
                    </div>
                    <button onClick={props.handleClick} type="submit">Next ></button>
                </label>
        </div>
    )
}

export default Form3
